const encryptedDataObject = {
    "iv": "885ff99ec90cbd3dc29dfbd4af3e13b0",
    "encryptedData": "",
    "index": 0
}

const key = '550b42040966307d66a0fb2c4ef99843b6e1a76dbb1aa976cbcf87b2e8ba1652' 

const iv = Buffer.from(encryptedDataObject.iv, 'hex')

const encryptedData =  Buffer.from(encryptedDataObject.encryptedData, 'hex')

console.log('encryptedData', encryptedData)
console.log('key', key)
console.log('iv', iv)

const decipher = crypto.createDecipheriv(
  'aes-256-cbc',
  Buffer.from(key, 'hex'),
  iv,
);
let decrypted = decipher.update(encryptedData);
decrypted = Buffer.concat([decrypted, decipher.final()]);
console.log(decrypted.toString('utf8'))

